                                                                            <div data-encore-id="text" style="border:0px none rgb(255, 255, 255);margin:0px;padding:0px;vertical-align:baseline;box-sizing:border-box;color:rgb(255, 255, 255);font-weight:700;font-family:SpotifyMixUI, CircularSp-Arab, CircularSp-Hebr, CircularSp-Cyrl, CircularSp-Grek, CircularSp-Deva, 'Helvetica Neue', helvetica, arial, 'Hiragino Kaku Gothic ProN', Meiryo, 'MS Gothic';font-size:16px;-webkit-tap-highlight-color:rgba(0, 0, 0, 0);margin-block:0px;">36,539,457 monthly listeners</div>
                                                                            <div data-encore-id="text" dir="auto" style="margin-top:8px;display:-webkit-box;-webkit-line-clamp:3;-webkit-box-orient:vertical;overflow:hidden;border:0px none rgb(255, 255, 255);padding:0px;vertical-align:baseline;box-sizing:border-box;color:rgb(255, 255, 255);font-family:SpotifyMixUI, CircularSp-Arab, CircularSp-Hebr, CircularSp-Cyrl, CircularSp-Grek, CircularSp-Deva, 'Helvetica Neue', helvetica, arial, 'Hiragino Kaku Gothic ProN', Meiryo, 'MS Gothic';font-size:16px;font-weight:400;-webkit-tap-highlight-color:rgba(0, 0, 0, 0);margin-block:8px 0px;">Since Roja hit movie screens in South India in 1992, A.R. Rahman has redefined the country's widely popular film music. Generally regarded as the finest Indian film composer of his time (and certainly the most commercially successful), Rahman produced music for dozens of widescreen releases just during his first five years in the industry. He has worked with many of his country's brightest music stars and a growing list of international luminaries, including <a href="spotify:artist:5HcunTidTUrOaf8V0iJcvl" style="border:0px none rgb(255, 255, 255);margin:0px;padding:0px;vertical-align:baseline;box-sizing:border-box;color:rgb(255, 255, 255);text-decoration:none solid rgb(255, 255, 255);touch-action:manipulation;">Nusrat Fateh Ali Khan</a>, <a href="spotify:artist:6DDCjHWtL6jTl1B5wG8tF6" style="border:0px none rgb(255, 255, 255);margin:0px;padding:0px;vertical-align:baseline;box-sizing:border-box;color:rgb(255, 255, 255);text-decoration:none solid rgb(255, 255, 255);touch-action:manipulation;">Zakir Hussain</a>, L. Shankar, <a href="spotify:artist:4sLklwvfOYr12fMGwrnlc7" style="border:0px none rgb(255, 255, 255);margin:0px;padding:0px;vertical-align:baseline;box-sizing:border-box;color:rgb(255, 255, 255);text-decoration:none solid rgb(255, 255, 255);touch-action:manipulation;">Apache Indian</a>, and <a href="spotify:artist:20vuBdFblWUo2FCOvUzusB" style="border:0px none rgb(255, 255, 255);margin:0px;padding:0px;vertical-align:baseline;box-sizing:border-box;color:rgb(255, 255, 255);text-decoration:none solid rgb(255, 255, 255);touch-action:manipulation;">David Byrne</a>.

                                                                                Born A.S. Dileep Kumar on October 10th, 1966, in Madras, India, Allah Rakha Rahman was exposed to music from the time he was a child, entered in classical piano studies by his parents at the age of four. At 16, he quit school and was following in his father's footsteps (R.K. Shekhar was a successful film musician, arranger, and conductor himself), working full-time as a session musician on soundtracks under the popular South Indian composer <a href="spotify:artist:3m49WVMU4zCkaVEKb8kFW7" style="border:0px none rgb(255, 255, 255);margin:0px;padding:0px;vertical-align:baseline;box-sizing:border-box;color:rgb(255, 255, 255);text-decoration:none solid rgb(255, 255, 255);touch-action:manipulation;">Ilaiyaraaja</a>. The monotony soon grew tiring however, and at the suggestion of a colleague, Rahman tried his hand at television commercials, eventually composing over 300 jingles in just five years.

                                                                                It wasn't until 1989 that Rahman planted the first seeds of his film career. That year, he began acquiring the equipment and organizing the sound library for his Panchathan Record Inn. When Sharada Trilok's ad for Leo Coffee (for which Rahman penned the music) won her an award, she introduced the young composer to her cousin, Mani Ratnam. Impressed with his work, the director signed Rahman to compose the music for K. Balachander's 1992 film Roja. Rahman's score, a colorful, uncluttered combination of pop, rock, reggae, and his country's traditional music, reshaped the genre, winning him three awards for Best Music Director. Roja became the equivalent of an Indian crossover success. Originally filmed in South Indian Tamil, it was re-dubbed (and its soundtrack re-recorded) in Hindi, the language of North India's famous Bollywood film center.

                                                                                His star on the rise, Rahman proceeded to compose music for six films in 1993 and nine in 1994, including the score for Ratnam's Bombay (1995), the story of a Hindu/Muslim marriage in a time of heated relations between the two cultures. Rahman's score displayed a characteristic (and appropriate) disregard for the confines of culture, be they Eastern or Western, once again mixing traditional and modern elements. Bombay was hugely successful and the movie's theme was featured on <a href="spotify:artist:30Y7JOpiNgAGEhnkYPdI1P" style="border:0px none rgb(255, 255, 255);margin:0px;padding:0px;vertical-align:baseline;box-sizing:border-box;color:rgb(255, 255, 255);text-decoration:none solid rgb(255, 255, 255);touch-action:manipulation;">Talvin Singh</a>'s Soundz of the Asian Underground compilation. Rahman became the first Indian artist to sign with <a href="spotify:search:label%3A%22Sony+Music%22" style="border:0px none rgb(255, 255, 255);margin:0px;padding:0px;vertical-align:baseline;box-sizing:border-box;color:rgb(255, 255, 255);text-decoration:none solid rgb(255, 255, 255);touch-action:manipulation;">Sony Music</a>, negotiating a three-year contract in 1997. His premier release for the label, Vande Mataram (his first collection of non-film music), was a tribute to India, commemorating 50 years of the country's independence. The album reached record stores in 28 countries on August 15 of that year.

                                                                                Rahman finally seemed poised on the brink of the international success he desired. Performances were booked in Europe, Canada, and the United States during the final years of the century and a session was arranged with singer <a href="spotify:artist:20vuBdFblWUo2FCOvUzusB" style="border:0px none rgb(255, 255, 255);margin:0px;padding:0px;vertical-align:baseline;box-sizing:border-box;color:rgb(255, 255, 255);text-decoration:none solid rgb(255, 255, 255);touch-action:manipulation;">David Byrne</a> (owner of the <a href="spotify:search:label%3A%22Luaka+Bop%22" style="border:0px none rgb(255, 255, 255);margin:0px;padding:0px;vertical-align:baseline;box-sizing:border-box;color:rgb(255, 255, 255);text-decoration:none solid rgb(255, 255, 255);touch-action:manipulation;">Luaka Bop</a> label and a Rahman fan). <a href="spotify:artist:4aP1lp10BRYZO658B2NwkG" style="border:0px none rgb(255, 255, 255);margin:0px;padding:0px;vertical-align:baseline;box-sizing:border-box;color:rgb(255, 255, 255);text-decoration:none solid rgb(255, 255, 255);touch-action:manipulation;">Andrew Lloyd Webber</a> chose Rahman to compose the music for his Bombay Dreams, a musical based on the Bollywood film industry. The pair began work on the project during the second half of 2000, and the musical opened in London during 2002. Bombay Dreams also ran for 284 regular performances at the Broadway Theatre in New York from April 2004 to January 2005.

                                                                                After the turn of the millennium, Rahman only saw his global recognition and acclaim grow, as he rose to the upper echelon of film composers worldwide. In 2005 he opened <a href="spotify:search:label%3A%22AM+Studios%22" style="border:0px none rgb(255, 255, 255);margin:0px;padding:0px;vertical-align:baseline;box-sizing:border-box;color:rgb(255, 255, 255);text-decoration:none solid rgb(255, 255, 255);touch-action:manipulation;">AM Studios</a> -- regarded as one of the foremost recording facilities in Asia -- as an adjunct to Panchathan Record Inn, and the following year the composer established his own record label, KM Music. Rahman served as musical director for nearly 50 films from 2001 through 2008, the majority being Hindi- or Tamil-language movies, including noteworthy collaborations with Roja and Bombay director Mani Ratnam (Kannathil Muthamittal, Ayutha Ezhuthu/Yuva, Guru). During that time, he also worked with Rajiv Menon (Kandukondain Kandukondain), Shaad Ali (Saathiya), Ashutosh Gowariker (Swades), and S. Shankar (Boys, Sivaji), the latter of whom, like Ratnam, also directed a number of films scored by Rahman during the '90s. He scored the 2003 Chinese (Mandarin-language) film Warriors of Heaven and Earth directed by He Ping and co-composed (with <a href="spotify:artist:526q7RxT5KA1VGeQ5GMSHO" style="border:0px none rgb(255, 255, 255);margin:0px;padding:0px;vertical-align:baseline;box-sizing:border-box;color:rgb(255, 255, 255);text-decoration:none solid rgb(255, 255, 255);touch-action:manipulation;">Craig Armstrong</a>) the score to the 2007 English-language film Elizabeth: The Golden Age, directed by Shekhar Kapur and starring Cate Blanchett.

                                                                                However, Rahman's widest recognition to that point -- at least with Western audiences -- came with British director Danny Boyle's 2008 hit film Slumdog Millionaire. It won eight Academy Awards in the United States, including Best Picture and Best Director as well as two for Rahman: Best Original Score and Best Song. Two Rahman songs from the film had been nominated for Oscars, "O... Saya" and "Jai Ho," the latter of which won the statuette for Rahman and for lyricist <a href="spotify:artist:0yRC5n90spXG0d3aiDQ0vB" style="border:0px none rgb(255, 255, 255);margin:0px;padding:0px;vertical-align:baseline;box-sizing:border-box;color:rgb(255, 255, 255);text-decoration:none solid rgb(255, 255, 255);touch-action:manipulation;">Gulzar</a>. In 2010, he was awarded the Padma Bhushan, India's third highest civilian award. The following year, he was nominated for two more Oscars, this time for best song and score for 2010's 127 Hours, also directed by Boyle.

                                                                                As he continued to write music for Indian cinema at a prolific rate, subsequent work in Hollywood included the 2014 <a href="spotify:artist:3xvaSlT4xsyk6lY1ESOspO" style="border:0px none rgb(255, 255, 255);margin:0px;padding:0px;vertical-align:baseline;box-sizing:border-box;color:rgb(255, 255, 255);text-decoration:none solid rgb(255, 255, 255);touch-action:manipulation;">Disney</a> co-production Million Dollar Arm and 2016's PelÃ©: Birth of a Legend. A year later, his music could be heard in the U.K.-India co-production Viceroy's House, directed by Gurinder Chadha. ~ Nathan Bush, Rovi</div>
